import React from "react";
import "../assets/css/Error.css";
import Img780908 from "../assets/img/Grupo_2574.png";

function Error() {
  return (
    <div className="ErrorBody">
        
        <div className="">
            <img src={Img780908} alt="" />
        </div>
      
    </div>
  );
}

export default Error;
